import React from 'react';
import  Professional from './Professional';
import  Personal from './Personal';
import  Upload from './Upload';
import  Varification from './Varification';
import { Route, Switch } from 'react-router-dom';


const App = () => {

    return (
              <>
               <h1 className="text-center my-3">Helpworx Technology Private Limited</h1>
                     <div className="container">
                         <div className="row">

                         <div class="btn-toolbar" role="toolbar" aria-label="Toolbar with button groups">
  <div class="btn-group me-2" role="group" aria-label="First group">
    <button type="button" class="btn btn-primary"><a href = "/Personal" >Personal Details</a></button>
    <button type="button" class="btn btn-primary">2</button>
    <button type="button" class="btn btn-primary">3</button>
    <button type="button" class="btn btn-primary">4</button>
  </div>
  
</div>
                         

                         </div>
                     </div>
                 

               
                <Switch>
                    <Route exact path="/Personal" component={Personal}/>
                    <Route exact path="/Professional" component={Professional}/>
                    <Route exact path="/Upload" component={Upload}/>
                    <Route exact path="/Varification" component={Varification}/>
                </Switch>
                
              </>

    );
}
export default App;
